wAAAIA0gY0dAAAAQJrAxg4AAAAgTWBjBwAAAJAmsLEDAAAASBPY2AEAAACk\nCWzsAAAAANIENnYAAAAAaeL/AZ+2pMxAc6ThAAAAAElFTkSuQmCC"},"metadata":{"image/png":{"height":420,"width":420}},"output_type":"display_data"}],"source":["# This R environment comes with many helpful analytics packages installed\n","# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n","# For example, here's a helpful package to load\n","\n","library(tidyverse) # metapackage of all tidyverse packages\n","library(lubridate)  #helps wrangle date attributes\n","library(ggplot2) #helps visualize data\n","# Input data files are available in the read-only \"../input/\" directory\n","# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n","\n","# COLLECT DATA\n","df1 <- read_csv(\"../input/divvytrips2021/202101-divvy-tripdata.csv\")\n","df2 <- read_csv(\"../input/divvytrips2021/202102-divvy-tripdata.csv\")\n","df3 <- read_csv(\"../input/divvytrips2021/202103-divvy-tripdata.csv\")\n","df4 <- read_csv(\"../input/divvytrips2021/202104-divvy-tripdata.csv\")\n","df5 <- read_csv(\"../input/divvytrips2021/202105-divvy-tripdata.csv\")\n","df6 <- read_csv(\"../input/divvytrips2021/202106-divvy-tripdata.csv\")\n","df7 <- read_csv(\"../input/divvytrips2021/202107-divvy-tripdata.csv\")\n","df8 <- read_csv(\"../input/divvytrips2021/202108-divvy-tripdata.csv\")\n","df9 <- read_csv(\"../input/divvytrips2021/202109-divvy-tripdata.csv\")\n","df10 <- read_csv(\"../input/divvytrips2021/202110-divvy-tripdata.csv\")\n","df11 <- read_csv(\"../input/divvytrips2021/202111-divvy-tripdata.csv\")\n","df12 <- read_csv(\"../input/divvytrips2021/202112-divvy-tripdata.csv\")\n","\n","# Stack individual  data frames into one big data frame\n","df <-rbind(df1,df2,df3,df4,df5,df6,df7,df8,df9,df10,df11,df12)\n","\n","df$started_hour <- lubridate::hour(df$started_at)\n","df$ended_hour <- lubridate::hour(df$ended_at)\n","df$day <- format(as.Date(df$started_at),\"%d\")\n","df$month <- format(as.Date(df$started_at),\"%m\")\n","df$week <- format(as.Date(df$started_at),\"%A\")\n","df$weekday = lubridate::wday(df$started_at,label= TRUE)\n","df$ride_length <- difftime(df$ended_at ,df$started_at)\n","\n","\n","\n","df %>% count(started_hour,sort=T) %>%\n","ggplot()+geom_line(aes(x=started_hour,y=n)) + scale_y_continuous(labels = scales::comma)+labs(title = \"Started Hour and Number of trips in last 12 Months\",y=\"Count of Trips\")\n","\n","# Compare members and casual users\n","aggregate(df$ride_length ~ df$member_casual, FUN = mean)\n","aggregate(df$ride_length ~ df$member_casual, FUN = median)\n","aggregate(df$ride_length ~ df$member_casual, FUN = max)\n","aggregate(df$ride_length ~ df$member_casual, FUN = min)\n","\n","df%>%\n","  group_by(weekday,rideable_type,member_casual)%>%\n","  summarise(count_of_rides=n(),Average= mean(df$ride_length),Maximum = max(ride_length)) %>%\n","  ggplot(aes(x=weekday,y=count_of_rides,fill= member_casual))+ geom_col(position = \"dodge\")+scale_y_continuous(labels = scales::comma)+facet_wrap(~rideable_type)\n","\n","\n","df%>% \n","  group_by(weekday,member_casual) %>%\n","  summarise(count_of_rides=n(),Average= mean(df$ride_length),Maximum = max(ride_length)) %>%\n","  ggplot(aes(x=weekday,y=count_of_rides,fill= member_casual))+ geom_col(position = \"dodge\")+scale_y_continuous(labels = scales::comma)+facet_wrap(~weekday)\n","\n","\n","df%>% \n","  group_by(df$month) %>%\n","  summarise(count_of_rides=n(),Average= mean(df$ride_length),Maximum = max(ride_length))\n","\n","df%>% \n","  group_by(month,member_casual) %>%\n","  summarise(count_of_rides=n(),Average= mean(df$ride_length),Maximum = max(ride_length))%>%\n","  ggplot(aes(x=month,y=count_of_rides,fill= member_casual))+ geom_col(position = \"dodge\")+scale_y_continuous(labels = scales::comma)+facet_wrap(~month)\n","\n","\n","\n","# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n","# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session"]},{"cell_type":"markdown","id":"d6942b1a","metadata":{"papermill":{"duration":0.009017,"end_time":"2022-12-20T10:36:50.264611","exception":false,"start_time":"2022-12-20T10:36:50.255594","status":"completed"},"tags":[]},"source":["**Conclusion**\n","* Casual riders use the bikes longer than the  membered riders \n","* Casual riders use the bikes mostly on weekends, membered  riders use on weekdays\n","* Riders use bikes more in summer and least in winter"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":96.92693,"end_time":"2022-12-20T10:36:50.595222","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-12-20T10:35:13.668292","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}